var title_f5_47_5878="Variations of aortic arch branching";
var content_f5_47_5878=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F54048&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F54048&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 611px\">",
"   <div class=\"ttl\">",
"    Variations of aortic arch branching",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 591px; height: 639px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Variations in the origin of the aortic arch branches. (A) and (B) represent the majority of anomalies found in the general population.",
"    <br>",
"     (A) Common origin of the left common carotid artery and brachiocephalic artery (bovine arch). Represents 73 percent of all branch variations.",
"     <br>",
"      (B) Origin of the left common carotid from the mid- to upper brachiocephalic artery. Represents 22 percent of all branch variations.",
"      <br>",
"       (C) Common carotid trunk giving origin to the left subclavian artery.",
"       <br>",
"        (D) Common carotid trunk, independent from both subclavian arteries.",
"        <br>",
"         (E) Left and right brachiocephalic arteries.",
"         <br>",
"          (F) Single arch vessel (brachiocephalic artery) originates the left common carotid and left subclavian arteries.",
"          <div class=\"footnotes\">",
"          </div>",
"          <div class=\"reference\">",
"           Reproduced with permission from: Uflacker R. Atlas Of Vascular Anatomy: An Angiographic Approach, Second Edition. Philadelphia: Lippincott Williams &amp; Wilkins, 2007. Copyright &copy; 2007 Lippincott Williams &amp; Wilkins.",
"          </div>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
