var title_f5_47_5885="Get up and go test";
var content_f5_47_5885=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F66046&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F66046&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    The \"Get up and go\" test for gait assessment in elderly patients",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        The \"Get up and go\" test for gait assessment in elderly patients",
"        <sup>",
"         [1]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Have the patient sit in a straight-backed high-seat chair",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Instructions for patient:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        Get up (without use of armrests, if possible)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        Stand still momentarily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        Walk forward 10 ft (3 m)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        Turn around and walk back to chair",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        Turn and be seated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Factors to note:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        Sitting balance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        Transfers from sitting to standing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        Pace and stability of walking",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\" colspan=\"2\">",
"        Ability to turn without staggering",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\" colspan=\"2\">",
"        Modified qualitative scoring",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        1) No fall risk",
"       </td>",
"       <td class=\"centered\">",
"        Well-coordinated movements, without walking aid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        2) Low fall risk",
"       </td>",
"       <td class=\"centered\">",
"        Controlled but adjusted movements",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        3) Some fall risk",
"       </td>",
"       <td class=\"centered\">",
"        Uncoordinated movements",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        4) High fall risk",
"       </td>",
"       <td class=\"centered\">",
"        Supervision necessary",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"centered\">",
"        5) Very high fall risk",
"       </td>",
"       <td class=\"centered\">",
"        Physical support of stand by physical support necessary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\" colspan=\"2\">",
"        Timed test (record time from initial rising to re-seating)",
"        <sup>",
"         [3]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"subtitle3\">",
"        Age (years)",
"       </td>",
"       <td class=\"subtitle3\">",
"        Mean time (seconds)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        60 to 69",
"       </td>",
"       <td class=\"centered\">",
"        8.1 (7.1 to 9.0)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        70 to 79",
"       </td>",
"       <td class=\"centered\">",
"        9.2 (8.2 to 10.2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        80 to 99",
"       </td>",
"       <td class=\"centered\">",
"        11.3 (10.0 to 12.7",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     <p>",
"      Sources:",
"     </p>",
"     <ol>",
"      <li>",
"       Reproduced with permission from: Fleming KC, Evand JM, Weber DC, Chutka DS. Practical Functional Assessment of Elderly Persons: A Primary-Care Approach [Symposium on Geriatrics-Part III]. Mayo Clinic Proceedings 1995; 70:890. Copyright &copy; 1995 Mayo Foundation.",
"      </li>",
"      <li>",
"       From: Nordin E, Lindel&ouml;f N, Rosendahl E. Prognostic validity of the Timed Up-and-Go test, a modified Get-Up-and-Go test, staff's global judgement and fall history in evaluating fall risk in residential care facilities. Age Ageing 2008; 37:442. By permission of the British Geriatrics Society. Copyright &copy; 2013 Oxford University Press.",
"      </li>",
"      <li>",
"       Data from: Bohannon RW. Reference Values for the Timed Upand Go Test: A Descriptive Meta-Analysis. J Geriatr Phys Ther 2006; 29:64.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
